    { label: 'Opção 1', value: '1' },
    { label: 'Opção 2', value: '2' },
    { label: 'Mpção 1', value: '1' },
    { label: 'Apção 2', value: '2' },
    { label: 'fpção 1', value: '1' },
    { label: 'gpaão 2', value: '2' },
    { label: 'gprão 1', value: '1' },
    { label: 'Apção 2', value: '2' },
    // ... outras opções
  ];

  newItem: Item = {
    name: '',
    price: 0,
    quantity: 0
  };

  order = {
    items: [] as Item[]
  };



  addItem() {
    this.order.items.push({ ...this.newItem });
    this.newItem = {
      name: '',
      price: 0,
      quantity: 0
    };
  }

  onSubmit() {
    console.log('Pedido:', this.order);
  }
}
